import React from 'react';

const UserHeader = ({ user }) => {
  if (!user) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>Welcome, {user.firstName}!</h1>
      <p>Your email: {user.email}</p>
      {/* Autres propriétés de l'utilisateur */}
    </div>
  );
};

export default UserHeader;
